import React,{useContext} from 'react';
import {useParams} from 'react-router-dom';
import '../index.css';
import {Table} from 'evergreen-ui';
import { PeopleContext } from '../contexts/PeopleContextProvider';

const LoginHistory = () => {
    const { data } = useContext(PeopleContext);
    const _id = useParams();
    const user = data.find(person=>person.id == _id);

    return(
        <div className="login-history">
        <Table>
            <Table.Head>
                <Table.TextHeaderCell>
                    Login History
                </Table.TextHeaderCell>
            </Table.Head>
            <Table.Body height={200}>
                {user.logins.map(item => (
                    <Table.Row >
                        <Table.TextCell>{item.date}</Table.TextCell>
                    </Table.Row>
                ))}
            </Table.Body>
        </Table>
        </div>
    )
}
export default LoginHistory;
